import React, { Component } from "react";
import Header from "../../components/header/Header";
import Footer from "../../components/footer/Footer";
import TopButton from "../../components/topButton/TopButton";
import SocialMedia from "../../components/socialMedia/SocialMedia";
import Button from "../../components/button/Button";
import { greeting, formPageData } from "../../portfolio.js";
import { Fade } from "react-reveal";
import OnLineForm from "../../components/forms/OnLineForm";
const FormData = formPageData.formSection;

class Form extends Component {
	constructor(props){
		super(props);
		this.state = {
			apiResponse: [],
		 };
	}
componentDidMount =() =>{
        //this.callAPI();
}
callAPI = () =>{
        const that = this;
        let dataResponse = "";
        fetch('http://192.168.253.128:4000/courses/course-list').then(
            function(response){
                return response.json();
            }
            ).then(function(jsonStr){
                dataResponse = jsonStr;
                if(jsonStr.statusType == 'error'){
                        that.props.history.push('/404');
                }else{
                        that.setState(
                                {
                                apiResponse : dataResponse
                                }
                        );
                }
            });
}
  render() {
    const theme = this.props.theme;
    return (
      <div className="contact-main">
        <Header theme={theme} />
        <div className="basic-contact">
          <h1 className="contact-heading-text" style={{ color: theme.text }}>
            {FormData["title"]}
          </h1>
          <Fade bottom duration={1000} distance="40px">
            <div className="contact-heading-div">
              <OnLineForm />
            </div>
          </Fade>
        </div>
        <Footer theme={this.props.theme} onToggle={this.props.onToggle} />
        <TopButton theme={this.props.theme} />
      </div>
    );
  }
}

export default Form;
